-- ----------------------------
-- Function structure for getParentList
-- ----------------------------
DROP FUNCTION IF EXISTS `getParentList`;
delimiter ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `getParentList`(rootId varchar(100)) RETURNS varchar(1000) CHARSET utf8
BEGIN   
DECLARE fid varchar(100) default '';   
DECLARE str varchar(1000) default '';   
DECLARE self  varchar(1000);
set self = rootId;
WHILE rootId is not null AND rootid != '-1'  do   
    SET fid =(SELECT PARENTNO FROM pdm_rescatalog WHERE CATALOGNO = rootId);  
    IF fid is not null  AND fid != '-1'THEN  				
					SET str = concat(str, ',', fid);	
					SET rootId = fid;   
    ELSE   
        SET rootId = fid;   
    END IF;   
END WHILE;   
return str;  
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for pdm_sp_resdel
-- ----------------------------
DROP PROCEDURE IF EXISTS `pdm_sp_resdel`;
delimiter ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `pdm_sp_resdel`(IN _tNO VARCHAR(20),
OUT result INT)
BEGIN
	DECLARE _resId VARCHAR(20);
	SET result=0;
	SELECT RESID INTO _resId FROM PDM_RES WHERE TNO=_tNO;
	IF _resId IS NOT NULL
	THEN
		DELETE FROM PDM_RESROLELINK WHERE RESID=_resId;
		-- IF ROW_COUNT() > 0
		-- THEN
			DELETE FROM PDM_RESUSERLINK WHERE RESID=_resId;
			-- IF ROW_COUNT() > 0
			-- THEN
				DELETE FROM PDM_CATARESLINK WHERE RESID=_resId;
				-- IF ROW_COUNT() > 0
				-- THEN
					DELETE FROM PDM_RESRELATION WHERE RESID=_resId;							
					-- IF ROW_COUNT() > 0
					-- THEN
						DELETE FROM PDM_RES WHERE TNO=_tNO;
						SET result=1;
					-- END IF;
				-- END IF;
			-- END IF;
		-- END IF;
	END IF;
	-- RETURN result -- 返回状态
END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table pdm_rescatalog
-- ----------------------------
DROP TRIGGER IF EXISTS `CATA_USER_LINK_DEL`;
delimiter ;;
CREATE DEFINER = `root`@`localhost` TRIGGER `CATA_USER_LINK_DEL` AFTER DELETE ON `pdm_rescatalog` FOR EACH ROW BEGIN
    DECLARE  _catano varchar(20);
    IF ROW_COUNT() <> 0   
    THEN
        SET _catano = OLD.catalogno;
        DELETE FROM PDM_CATAUSERLINK WHERE CATALOGNO=_catano;
        DELETE FROM PDM_CATAROLELINK WHERE CATALOGNO=_catano;
    END IF;
END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table pdm_systemroles
-- ----------------------------
DROP TRIGGER IF EXISTS `ROLES_TRG_LOG_INSERT`;
delimiter ;;
CREATE DEFINER = `root`@`localhost` TRIGGER `ROLES_TRG_LOG_INSERT` AFTER INSERT ON `pdm_systemroles` FOR EACH ROW BEGIN 
    DECLARE _tNO varchar(20); -- tNO
    DECLARE _userId varchar(10); -- userId（指创建者的userID）
    DECLARE _inputUser varchar(10); -- 创建者（userName）
    DECLARE _roleName varchar(10); -- 指被创建的角色
    DECLARE _logTime datetime;  -- 日志时间
    DECLARE _status nvarchar(50); -- 状态
    DECLARE _description nvarchar(50); -- 说明
    DECLARE _remark nvarchar(50); --
    DECLARE  _seconds varchar(20);
    DECLARE  _rad varchar(20);
   
    SET  _seconds = (select LEFT(date_format(current_timestamp(3),'%Y%m%d%H%i%s%f'), 17));
    SET  _rad = (select floor(rand()*90+10));  -- 获取随机数
    SET _tNO = CONCAT(_seconds , _rad);   -- 拼接字符串
    -- 根据创建者名称查询userId  
    SET _inputUser  = NEW.inputuser;
    select USERID INTO _userId from PDM_USERS WHERE USERNAME = _inputUser;   
    SET _roleName  = NEW.roleName;
    SET _status  = NEW.status;
    SET _description  = CONCAT(_inputUser, ' 创建角色 ',_roleName);
    SET _logTime  = NOW();
END
;;
delimiter ;

